def find_elements_occurring_more_than_n_over_3_times(arr, n):
    d = {}
    res = []
    comp = n / 3
    for elem in arr:
        d[elem] = d.get(elem, 0) + 1
        if d[elem] > comp:
            res.append(elem)
            d[elem] = float('-inf')
    res.sort()
    return res if res else [-1]

